	function generate_random_string($length=12) {
	        $str                  = "";
	        $characters         = array_merge(range('a','z'), range('0','9'));
	        $max                = count($characters) - 1;
	        for ($i = 0; $i < $length; $i++) {
	            $rand = mt_rand(0, $max);
	            $str .= $characters[$rand];
	        }
	        return $str;
	    }


